class Solution:
    def maxProduct(self, nums: 'List[int]') -> int:
        minn = [nums[0]]
        maxx = [nums[0]]
        for n in nums[1:]:
            mi = min(minn[-1] * n, maxx[-1] * n, n)
            mx = max(minn[-1] * n, maxx[-1] * n, n)
            minn.append(mi)
            maxx.append(mx)
        return max(maxx)
    


